using CommunityToolkit.Mvvm.Messaging;
using System;
using System.Diagnostics;
using System.Threading.Tasks;
using TrarsUI.Shared.Messages;

namespace vNekoChatUI.A.MVVM.Models
{
    internal partial class DefaultProfile
    {
        const string version = "20250228";

        private string[] prompt { get; set; } = [
            "",
            "",
            "",
            "",
            "",
            "",
            "UyuuXYyxDw6lk29xQn+l+FDCRfdUNspYwhoRu2hn5DQ=",
        ];
        private string @continue { get; set; } = "";

        string defAesKey;
        string defToken;

        public DefaultProfile(string aesKey, string token)
        {
            defAesKey = aesKey;
            defToken = token;

            Task.Run(async () =>
            {
                try
                {
                    for (int i = 0; i < prompt.Length; i++)
                    {
                        prompt[i] = (await AesDecrypt(prompt[i])).Trim();
                    }
                    @continue = await AesDecrypt(@continue);
                }
                catch (Exception ex)
                {
                    Debug.WriteLine($"DefaultProfile: {ex.Message}");
                }
            }).Wait();
        }
    }

    internal partial class DefaultProfile
    {
        public string GetDefaultProfile()
        {
            var result = string.Empty;
            for (int i = 0; i < prompt.Length; i++)
            {
                result += prompt[i].Trim().Replace("\\r\\n", "\n") + "\n\n";
            }
            return result.Trim();
        }

        public string GetDefaultContinuePrompt()
        {
            var result = @continue.Trim().Replace("\\r\\n", "\n");
            return result;
        }
    }

    internal partial class DefaultProfile
    {
        private async Task<string> AesDecrypt(string text)
        {
            if (!System.Buffers.Text.Base64.IsValid(text)) { return text; }

            var response = await WeakReferenceMessenger.Default.Send(new StringDecryptMessage()
            {
                AesKey = defAesKey,
                TextSrc = text
            }, defToken);
            return response;
        }
    }
}
